import React from "react";
import Typed from 'react-typed';

const  Hero = () =>{
    const profile = "./assets/images/avator.png";
    
    return(
        <div className="text-white">
            <div className="max-w-[800px] mx-auto text-center h-screen w-full  flex flex-col justify-center mt-[-90px]">
                
                <p className="text-[#00df9a] font-bold p-2 text-1xl">Bio</p>
                <h1 className="md:text-7xl sm:text-6xl text-4xl font-bold md:py-4">ZUlqarnain Sarwar</h1>
                <div className="flex justify-center items-center">
                    <p className="md:text-4xl sm:text-4xl text-xl font-serif " > Front-End Dev ,Wordpress </p>
                    <Typed  strings={[ 'Dev', 'In Exarta']} typeSpeed={120} backSpeed={150} loop className="md:text-3xl  sm:text-2xl text-xl font-serif pl-2 "/>
                    <img src={profile} />
                </div>

            </div>
        </div>
    )
}
export default Hero;
